import { NavLink } from "react-router-dom";
import "./styles/Navbar.css";

function NavBar({ backgroundColor, isSignedIn }) {
	return (
		<div className="navbar" style={{ backgroundColor: backgroundColor }}>
			{isSignedIn ? (
				<div></div>
			) : (
				<div id="left-div" style={{ width: "60px" }}></div>
			)}
			<NavLink to="/">
				<img src="logo.svg" alt="Logo" className="logo" />
			</NavLink>
			{isSignedIn ? (
				<div></div>
			) : (
				<NavLink to="/sign-in" className="sign-in-nav">
					<p>Sign in</p>
				</NavLink>
			)}
		</div>
	);
}

export default NavBar;
